CREATE DEFINER=`root`@`localhost` PROCEDURE `ApproveExamsByBO`(


    IN p_anssheets_log_id INT,
    IN examsub_id INT
)
BEGIN
    DECLARE inserted_anssheets_count INT;

    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        -- Rollback the transaction in case of an error
        ROLLBACK;
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Transaction failed';
    END;

    START TRANSACTION;

    -- Fetch ans_sheet_stud_id, ans_sheet_link, ans_sheet_standerd_id and insert into tbl_external_eval_anssheet
    INSERT INTO tbl_external_eval_anssheet (ex_anssheet_exam_student_id, ex_anssheet_exam_sub_id, ex_anssheet_link, ex_branch_id)
    SELECT ans_sheet_stud_id, ans_sheet_exam_sub_id, ans_sheet_link, ans_sheet_branch_id
    FROM tbl_examsub_ans_sheet
    WHERE ans_sheet_exam_sub_id = examsub_id;

    -- Get the count of inserted rows
    SET inserted_anssheets_count = ROW_COUNT();

    -- Update ex_quepaper_link, ex_modelanssheet_link, and ex_standerd_id in tbl_external_eval_anssheet
    SET @prev_sql_safe_updates = @@SQL_SAFE_UPDATES;
    SET SQL_SAFE_UPDATES = 0;

    UPDATE tbl_external_eval_anssheet ee
    JOIN tbl_exam_subject esub ON ee.ex_anssheet_exam_sub_id = esub.exmsub_id
    SET ee.ex_quepaper_link = esub.que_paper_link,
        ee.ex_modelanssheet_link = esub.model_ans_link,
        ee.ex_standerd_id = esub.exmsub_standerd_id
    WHERE ee.ex_anssheet_exam_sub_id = examsub_id;

    SET SQL_SAFE_UPDATES = @prev_sql_safe_updates;

    -- Update the log status and the total count in tbl_anssheets_log
    UPDATE tbl_anssheets_log
    SET anssheets_accept_status = 2
    WHERE anssheets_log_id = p_anssheets_log_id;

    COMMIT;
END ;;
