DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `AssignAnsSheetsToModerator`(IN p_standerd_id INT, IN p_examsub_id INT)
BEGIN
    -- Variable Declarations
    DECLARE total_marks INT;
    DECLARE obtained_marks INT;
    DECLARE student_id INT;
    DECLARE exmsub_id INT;
    DECLARE percentage DECIMAL(5, 2);
    DECLARE moderator_user_id INT;
    DECLARE done INT DEFAULT FALSE;
    DECLARE v_error_message VARCHAR(255);
    DECLARE inserted_count INT DEFAULT 0; -- Variable to count inserted students

    -- Cursor Declaration with examsub_id filtering
    DECLARE cur CURSOR FOR 
        SELECT ex_result_total_marks, ex_result_obtained_marks, ex_result_student_id, ex_result_exmsub_id 
        FROM tbl_external_result
        WHERE ex_result_exmsub_id = p_examsub_id;  -- Filter by examsub_id

    -- Handler Declaration
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    -- Transaction Handling
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        -- Rollback the transaction in case of an error
        ROLLBACK;
        -- Re-throw the error with a custom error message
        RESIGNAL;
    END;

    -- Start the transaction
    START TRANSACTION;

    -- Ensure the temporary table is dropped if it already exists
    DROP TEMPORARY TABLE IF EXISTS temp_eligible_students;

    -- Temporary table for storing eligible student IDs and exam subject IDs
    CREATE TEMPORARY TABLE temp_eligible_students (
        student_id INT,
        exmsub_id INT
    );

    -- Open the cursor and loop through the records
    OPEN cur;

    read_loop: LOOP
        FETCH cur INTO total_marks, obtained_marks, student_id, exmsub_id;
        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Calculate the percentage
        SET percentage = (obtained_marks / total_marks) * 100;

        -- Insert into the temporary table if conditions are met
        IF percentage > 95 OR (percentage BETWEEN 30 AND 35) THEN
            INSERT INTO temp_eligible_students (student_id, exmsub_id)
            VALUES (student_id, exmsub_id);
            
            -- Increment the inserted count
            SET inserted_count = inserted_count + 1;
        END IF;
    END LOOP;

    -- Close the cursor
    CLOSE cur;

    -- Find a moderator with mod_anssheet_count less than 50
    SELECT mod_user_id 
    INTO moderator_user_id
    FROM tbl_mod_applied_standerd
    WHERE mod_standerd_id = p_standerd_id AND mod_anssheet_count < 50
    ORDER BY RAND() LIMIT 1;

    IF moderator_user_id IS NULL THEN
        SET v_error_message = 'No moderator found with less than 50 answer sheets for the provided standerd_id';
        SIGNAL SQLSTATE '45001' SET MESSAGE_TEXT = v_error_message;
    END IF;

    -- Update the tbl_external_eval_anssheet with the chosen moderator
    UPDATE tbl_external_eval_anssheet e
    JOIN temp_eligible_students t
    ON e.ex_anssheet_exam_sub_id = t.exmsub_id AND e.ex_anssheet_exam_student_id = t.student_id
    SET e.ex_moderator_id = moderator_user_id, e.ex_anssheet_status = 6;

    IF (SELECT ROW_COUNT()) = 0 THEN
        SET v_error_message = 'No answer sheets found for the given exam sub ID and student ID';
        SIGNAL SQLSTATE '45002' SET MESSAGE_TEXT = v_error_message;
    END IF;

    -- Update the tbl_anssheets_log for answer sheets assigned for moderator
    UPDATE tbl_anssheets_log al
    SET al.anssheets_status = 3,
        al.anssheets_assign_to_moderater_count = inserted_count
    WHERE al.anssheets_examsub_id = p_examsub_id AND al.anssheets_standerd_id = p_standerd_id;

    IF (SELECT ROW_COUNT()) = 0 THEN
        SET v_error_message = 'Failed to update the log status and count for the given exam sub ID and standerd ID';
        SIGNAL SQLSTATE '45003' SET MESSAGE_TEXT = v_error_message;
    END IF;

    -- Clean up: Drop the temporary table
    DROP TEMPORARY TABLE IF EXISTS temp_eligible_students;

    -- Commit the transaction  
    COMMIT;

    -- Return the inserted count as an output
    SELECT inserted_count AS students_inserted_count;
END ;;
DELIMITER ;
