CREATE DEFINER=`root`@`localhost` PROCEDURE `AssigningAnsSheetsToExEvaluator`(
    IN standerd_id_param INT,
    IN Exam_subId_param INT,
     IN branchId_param INT
)
BEGIN
    -- Declare necessary variables
    DECLARE done_evaluators INT DEFAULT FALSE;
    DECLARE done_ans_sheets INT DEFAULT FALSE;
    DECLARE current_evl_user_id INT;
    DECLARE total_pending_count INT;

    -- Declare cursors
    DECLARE cur CURSOR FOR 
        SELECT evl_user_id FROM tbl_evl_applied_standerd WHERE evl_standerd_id = standerd_id_param;

    -- Handlers for when no more rows are found
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done_evaluators = TRUE;
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        -- Cleanup
        RESIGNAL;
    END;

    -- Delete previous data from permanent tables using a WHERE clause with a key column
    DELETE FROM tbl_permanent_evaluators 
    WHERE temp_evl_id IS NOT NULL;

    DELETE FROM tbl_permanent_ans_sheets 
    WHERE temp_anssheet_id IS NOT NULL;

    -- Insert answer sheet details into the permanent table
    INSERT INTO tbl_permanent_ans_sheets (ans_sheet_stud_id, ans_sheet_link, ans_sheet_exam_sub_id)
    SELECT ans_sheet_stud_id, ans_sheet_link, Exam_subId_param
    FROM tbl_examsub_ans_sheet
    WHERE ans_sheet_exam_sub_id = Exam_subId_param AND ans_sheet_branch_id=branchId_param;

    -- Debug: Verify data in tbl_permanent_ans_sheets
    SELECT * FROM tbl_permanent_ans_sheets WHERE ans_sheet_exam_sub_id = Exam_subId_param;

    -- Open the evaluator cursor
    OPEN cur;

    -- Fetch the first row
    FETCH cur INTO current_evl_user_id;

    -- Loop through the evaluators
    read_evaluators_loop: LOOP
        IF done_evaluators THEN
            LEAVE read_evaluators_loop;
        END IF;

        -- Check the total pending count for the current evaluator
        SELECT COUNT(*) INTO total_pending_count
        FROM tbl_external_eval_anssheet
        WHERE ex_evaluator_id = current_evl_user_id AND ex_anssheet_status IN (1, 2);

        -- Insert into the tbl_permanent_evaluators table
        INSERT INTO tbl_permanent_evaluators (evl_user_id, pending_count)
        VALUES (current_evl_user_id, total_pending_count);

        -- Fetch the next row
        FETCH cur INTO current_evl_user_id;
    END LOOP read_evaluators_loop;

    -- Close the evaluator cursor
    CLOSE cur;

    -- Debug: Verify data in tbl_permanent_evaluators
    SELECT * FROM tbl_permanent_evaluators WHERE evl_user_id IN (SELECT evl_user_id FROM tbl_evl_applied_standerd WHERE evl_standerd_id = standerd_id_param);
END ;;
