CREATE DEFINER=`root`@`localhost` PROCEDURE `AssigningAnsSheetsToExEvaluator1`(
    IN p_standerd_id INT,
      IN p_examsub_id INT,
      IN p_anssheet_count INT
    
  
)
BEGIN
    DECLARE v_evaluator_id INT;
    DECLARE v_error_message VARCHAR(255);

    -- Start transaction
    START TRANSACTION;

    BEGIN
        DECLARE EXIT HANDLER FOR SQLEXCEPTION
        BEGIN
            -- Rollback the transaction in case of an error
            ROLLBACK;
            -- Re-throw the error
            RESIGNAL;
        END;

        SET v_evaluator_id = NULL;

        -- Find a random evaluator with less than 50 answer sheets
        SELECT evl_user_id INTO v_evaluator_id
        FROM tbl_evl_applied_standerd
        WHERE evl_standerd_id = p_standerd_id AND evl_anssheet_count < 50
        ORDER BY RAND()
        LIMIT 1;

        IF v_evaluator_id IS NULL THEN
            SET v_error_message = 'No evaluator present for this standerd id OR No evaluator available with less than 50 answer sheets';
            SIGNAL SQLSTATE '45001' SET MESSAGE_TEXT = v_error_message;
        END IF;

        -- Output the selected evaluator ID for debugging
        SELECT v_evaluator_id AS selected_evaluator_id;

        -- Update tbl_external_eval_anssheet with the selected evaluator
        UPDATE tbl_external_eval_anssheet
        SET ex_evaluator_id = v_evaluator_id, ex_anssheet_status = 2
        WHERE ex_anssheet_exam_sub_id = p_examsub_id;

        -- Check if any rows were updated
        IF (SELECT FOUND_ROWS()) = 0 THEN
            SET v_error_message = 'No answer sheets found for the given exam sub ID';
            SIGNAL SQLSTATE '45002' SET MESSAGE_TEXT = v_error_message;
        END IF;

        -- Update the answer sheet count for the given evaluator
        UPDATE tbl_evl_applied_standerd
        SET evl_anssheet_count = evl_anssheet_count + p_anssheet_count
        WHERE evl_user_id = v_evaluator_id AND evl_standerd_id = p_standerd_id;

        -- Check if any rows were updated
        IF (SELECT FOUND_ROWS()) = 0 THEN
            SET v_error_message = 'Failed to update the evaluator answer sheet count';
            SIGNAL SQLSTATE '45003' SET MESSAGE_TEXT = v_error_message;
        END IF;

        -- Update tbl_anssheets_log with the status
        UPDATE tbl_anssheets_log
        SET anssheets_status = 2
        WHERE anssheets_examsub_id = p_examsub_id;

        -- Check if any rows were updated
        IF (SELECT FOUND_ROWS()) = 0 THEN
            SET v_error_message = 'Failed to update the log status';
            SIGNAL SQLSTATE '45004' SET MESSAGE_TEXT = v_error_message;
        END IF;

        -- Commit the transaction if all updates were successful
        COMMIT;
    END;
END ;;
DELIMITER ;
