        tal.anssheets_class_name,
        tal.anssheets_div_name,
        tal.anssheets_sub_name,
        tal.anssheets_exam_name,
        tal.anssheets_examsub_id,
        tal.anssheets_standerd_id,
        tal.anssheets_total_log_count AS anssheet_count,
        CASE
            WHEN tal.anssheets_status = 3 THEN 'Status 3'
            WHEN tal.anssheets_status = 4 THEN 'Status 4'
        END AS status_group
    FROM
        tbl_anssheets_log tal
    WHERE 
        tal.anssheets_assign_to_moderater_count = tal.anssheets_moderater_count
        AND (tal.anssheets_status = 3 OR tal.anssheets_status = 4)
    ORDER BY
        tal.anssheets_status;
END ;;
