CREATE DEFINER=`root`@`localhost` PROCEDURE `Evaluation_By_ExEvaluator`(
 
    IN p_userId INT,
    IN p_studentId INT,
    IN p_examsubId INT,
    IN p_totalMarks DECIMAL(10, 2),
    IN p_All_Obtained_marks DECIMAL(10, 2),
    IN p_Result_Remark TEXT,
    IN p_resultVoiceRemarkFilePath VARCHAR(255),
    IN p_evaluations JSON
)
BEGIN
    DECLARE questionId INT;
    DECLARE obtainedMarks DECIMAL(10, 2);
    DECLARE Question_Remark TEXT;
    DECLARE question_total_mark DECIMAL(10, 2);
    DECLARE i INT DEFAULT 0;
    DECLARE evaluationsCount INT;
    DECLARE v_error_message VARCHAR(255);

    -- Declare exit handlers
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        -- Rollback the transaction if any SQL error occurs
        ROLLBACK;
        -- Re-throw the error with a custom message if available
        IF v_error_message IS NOT NULL THEN
            SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = v_error_message;
        ELSE
            SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'An error occurred during the procedure execution.';
        END IF;
    END;

    -- Get the number of evaluations in the JSON array
    SET evaluationsCount = JSON_LENGTH(p_evaluations);

    -- Start the transaction
    START TRANSACTION;

    -- Loop through each evaluation in the JSON array
    WHILE i < evaluationsCount DO
        -- Extract each field from the JSON array
        SET questionId = CAST(JSON_UNQUOTE(JSON_EXTRACT(p_evaluations, CONCAT('$[', i, '].questionId'))) AS UNSIGNED);
        SET obtainedMarks = CAST(JSON_UNQUOTE(JSON_EXTRACT(p_evaluations, CONCAT('$[', i, '].obtainedMarks'))) AS DECIMAL(10, 2));
        SET Question_Remark = JSON_UNQUOTE(JSON_EXTRACT(p_evaluations, CONCAT('$[', i, '].Question_Remark')));
        SET question_total_mark = CAST(JSON_UNQUOTE(JSON_EXTRACT(p_evaluations, CONCAT('$[', i, '].question_total_mark'))) AS DECIMAL(10, 2));

        -- Insert into tbl_ans_evaluation_ex_evaluator
        INSERT INTO tbl_ans_evaluation_ex_evaluator (
            ex_evaluation_student_id, 
            ex_evaluation_exam_sub_id, 
            ex_evaluation_que_id, 
            ex_evaluation_total_que_mark, 
            ex_evaluation_marks_obtained, 
            ex_evaluation_remarks, 
            created_by
        ) VALUES (
            p_studentId, 
            p_examsubId, 
            questionId, 
            question_total_mark, 
            obtainedMarks, 
            Question_Remark, 
            p_userId
        );

        -- Check if the insertion was successful
        IF (ROW_COUNT() = 0) THEN
            SET v_error_message = CONCAT('Failed to insert evaluation data for question ID ', questionId);
            SIGNAL SQLSTATE '45001' SET MESSAGE_TEXT = v_error_message;
        END IF;

        -- Increment the loop counter
        SET i = i + 1;
    END WHILE;

    -- Insert result data
    INSERT INTO tbl_external_result (
        ex_result_exmsub_id, 
        ex_result_student_id, 
        ex_result_total_marks, 
        ex_result_obtained_marks, 
        ex_result_remark, 
        ex_result_voice_remark, 
        created_by
    ) VALUES (
        p_examsubId, 
        p_studentId, 
        p_totalMarks, 
        p_All_Obtained_marks, 
        p_Result_Remark, 
        p_resultVoiceRemarkFilePath, 
        p_userId
    );

    -- Check if the insertion was successful
    IF (ROW_COUNT() = 0) THEN
        SET v_error_message = CONCAT('Failed to insert result data for student ID ', p_studentId);
        SIGNAL SQLSTATE '45002' SET MESSAGE_TEXT = v_error_message;
    END IF;

    -- Update the answer sheet status
    UPDATE tbl_external_eval_anssheet 
    SET ex_anssheet_status = 5 
    WHERE ex_anssheet_exam_sub_id = p_examsubId 
      AND ex_anssheet_exam_student_id = p_studentId;

    -- Check if any rows were updated in tbl_external_eval_anssheet
    IF (ROW_COUNT() = 0) THEN
        SET v_error_message = 'No answer sheets found for the given exam sub ID and student ID';
        SIGNAL SQLSTATE '45003' SET MESSAGE_TEXT = v_error_message;
    END IF;

    -- Update the anssheets_evaluated_count
    UPDATE tbl_anssheets_log
    SET anssheets_evaluated_count = COALESCE(anssheets_evaluated_count, 0) + 1
    WHERE anssheets_examsub_id = p_examsubId;

    -- Check if any rows were updated in tbl_anssheets_log
    IF (ROW_COUNT() = 0) THEN
        SET v_error_message = 'No record found in tbl_anssheets_log for the given exam sub ID';
        SIGNAL SQLSTATE '45004' SET MESSAGE_TEXT = v_error_message;
    END IF;

    -- Commit the transaction
    COMMIT;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
