CREATE DEFINER=`root`@`localhost` PROCEDURE `ExamDataForTeacher`(IN teacher_id_param INT)
BEGIN
    SELECT 
        exmsub.exmsub_id AS ExamSubjectID,
        exmsub.exmsub_exam_id AS ExamID,
        exam.exam_name AS ExamName,           -- Added exam name
        exmsub.exmsub_class_id AS ClassID,
        class.class_name AS ClassName,
        exmsub.exmsub_division_id AS DivisionID,
        d.div_name AS DivisionName,
        exmsub.exmsub_subject_id AS SubjectID,
        sub.sub_name AS SubjectName
       
    FROM 
        tbl_exam_subject exmsub
    JOIN 
        tbl_exam exam ON exmsub.exmsub_exam_id = exam.exam_id   -- Joining with the exam table
    JOIN 
        tbl_class class ON exmsub.exmsub_class_id = class.class_id
    JOIN 
        tbl_division d ON exmsub.exmsub_division_id = d.div_id
    JOIN 
        tbl_subject sub ON exmsub.exmsub_subject_id = sub.sub_id
    JOIN 
    tbl_class_div cd ON  exmsub.exmsub_class_id = cd.clsdiv_class_id AND 
    exmsub.exmsub_division_id = cd.clsdiv_div_id
    JOIN
        tbl_class_div_sub_teach cdst ON cd.clsdiv_id = cdst.cdst_cls_div_id
        AND exmsub.exmsub_subject_id = cdst.cdst_sub_id
    WHERE 
        cdst.cdst_teach_id = teacher_id_param 
        AND exmsub.exam_status IN (5, 6);     -- Exam status condition
END ;;
