CREATE DEFINER=`root`@`localhost` PROCEDURE `GetAllMenuPermissions`()
BEGIN
    SELECT
        m.menu_name AS menuName,
        GROUP_CONCAT(CONCAT(mp.menu_permission_id, '-', p.permission)) AS menu_permission_id
    FROM
        tbl_menu m
    LEFT JOIN
        tbl_menu_permission mp ON m.menu_id = mp.menu_per_menu_id
    LEFT JOIN
        tbl_permission p ON mp.menu_per_permission_id = p.permission_id
    GROUP BY
        m.menu_id, m.menu_name;
END ;;
