CREATE DEFINER=`root`@`localhost` PROCEDURE `GetAllStudentsMarksSubjectWise`(
    IN exam_id_param INT, 
    IN class_id_param INT, 
    IN div_id_param INT, 
    IN subject_id_param INT
)
BEGIN
    SELECT 
        result_student_id,
        student_name,
        exam_name,
        class_name,
        division_name,
        sub_name,
        result_total_marks,
        result_obtained_marks,
        (CAST(result_obtained_marks AS DECIMAL(10,2)) / CAST(result_total_marks AS DECIMAL(10,2))) * 100 AS percentage,
        CASE 
            WHEN (CAST(result_obtained_marks AS DECIMAL(10,2)) / CAST(result_total_marks AS DECIMAL(10,2))) * 100 >= 35 THEN 'Pass'
            ELSE 'Fail'
        END AS result_status
    FROM 
        vw_comprehensive_results
    WHERE 
        exam_id = exam_id_param 
        AND class_id = class_id_param 
        AND division_name = div_id_param 
        AND sub_id = subject_id_param;
END ;;
