CREATE DEFINER=`root`@`localhost` PROCEDURE `GetAnsSheetDataByStatus`()
BEGIN
    SELECT 
        tea.ex_anssheet_exam_sub_id,
        tea.ex_evaluator_id,
        tea.ex_branch_id,
        b.branch_name,
        es.exmsub_id,
        es.exmsub_exam_id,
        e.exam_name,
        es.exmsub_class_id,
        c.class_name,
        es.exmsub_division_id,
        d.div_name,
        es.exmsub_subject_id,
        s.sub_name,
        
        -- Count of answer sheets for status 3
        (SELECT COUNT(*) 
         FROM tbl_external_eval_anssheet 
         WHERE ex_anssheet_status = 3 AND ex_anssheet_exam_sub_id = tea.ex_anssheet_exam_sub_id
        ) AS status_3_count,

        -- Count of answer sheets for status 7
        (SELECT COUNT(*) 
         FROM tbl_external_eval_anssheet 
         WHERE ex_anssheet_status = 7 AND ex_anssheet_exam_sub_id = tea.ex_anssheet_exam_sub_id
        ) AS status_7_count

    FROM 
        tbl_external_eval_anssheet tea
    JOIN tbl_branch b ON tea.ex_branch_id = b.branch_id
    JOIN tbl_exam_subject es ON tea.ex_anssheet_exam_sub_id = es.exmsub_id
    JOIN tbl_exam e ON es.exmsub_exam_id = e.exam_id
    JOIN tbl_class c ON es.exmsub_class_id = c.class_id
    JOIN tbl_division d ON es.exmsub_division_id = d.div_id
    JOIN tbl_subject s ON es.exmsub_subject_id = s.sub_id    
    WHERE 
        tea.ex_anssheet_status IN (3, 7)
    GROUP BY 
        tea.ex_anssheet_exam_sub_id,
        tea.ex_evaluator_id,
        tea.ex_branch_id,
        b.branch_name,
        es.exmsub_id,
        es.exmsub_exam_id,
        e.exam_name,
        es.exmsub_class_id,
        c.class_name,
        es.exmsub_division_id,
        d.div_name,
        es.exmsub_subject_id,
        s.sub_name;
END ;;
DELIMITER ;
