CREATE DEFINER=`root`@`localhost` PROCEDURE `GetAnsSheetsDataForBOsSecondScreen`()
BEGIN
    -- Fetch exams grouped by anssheets_log_id with counts of evaluated answer sheets
    SELECT 
        al.anssheets_log_id,
        al.anssheets_school_name,
        al.anssheets_class_name,
        al.anssheets_div_name,
        al.anssheets_sub_name,
        al.anssheets_exam_name,
        al.anssheets_total_marks,
        al.anssheets_examsub_id,
        al.anssheets_standerd_id,
        al.anssheets_school_id,
        al.anssheets_total_log_count AS anssheet_count
    FROM 
        tbl_anssheets_log al
    WHERE 
        al.anssheets_accept_status = 2 AND al.anssheets_status=1
    GROUP BY 
        al.anssheets_log_id,
        al.anssheets_school_name,
        al.anssheets_class_name,
        al.anssheets_div_name,
        al.anssheets_sub_name,
        al.anssheets_exam_name,
        al.anssheets_total_marks,
        al.anssheets_examsub_id,
        al.anssheets_standerd_id,
        al.anssheets_school_id,
        al.anssheets_evaluated_count
    ORDER BY 
        al.anssheets_standerd_id, 
        al.anssheets_examsub_id;
END ;;
