CREATE DEFINER=`root`@`localhost` PROCEDURE `GetApprovedExamsForEvaluator`(IN user_id_param INT)
BEGIN
    SELECT 
        c.class_name, c.class_id,  s.sub_name, s.sub_id, e.exam_name, e.exam_id,es.exmsub_id,
        eva_exam_stud_anssheet_count
    FROM 
         tbl_external_eval_exam_view ev
         JOIN tbl_exam_subject es ON ev.eva_examsub_id=es.exmsub_id
    JOIN 
        tbl_exam e ON es.exmsub_exam_id = e.exam_id
    JOIN 
        tbl_class c ON es.exmsub_class_id = c.class_id
    JOIN 
