CREATE DEFINER=`root`@`localhost` PROCEDURE `GetClassTopperFromTeacherAndExam`(
    IN teacher_id_param INT, 
    IN exam_id_param INT
)
BEGIN
    SELECT 
        result_student_id,
        user_name,
        exam_name,
        class_name,
        class_id,
        div_name,
        SUM(result_total_marks) AS total_marks,
        SUM(result_obtained_marks) AS obtained_marks,
        AVG(percentage) AS overall_percentage,
        CASE
            WHEN AVG(percentage) >= 35 THEN 'Pass'
            ELSE 'Fail'
        END AS result_status
    FROM 
        vw_student_performance
    WHERE 
        class_teacher_id = teacher_id_param AND 
        exam_id = exam_id_param
    GROUP BY 
        result_student_id,
        user_name,
        exam_name,
        class_name,
            class_id,
        div_name
    ORDER BY 
        overall_percentage DESC;
END ;;
