CREATE DEFINER=`root`@`localhost` PROCEDURE `GetDataForScannerFromUserIdExamIdClassId`(IN scnusr_user_id_param INT, IN exam_id_param INT, IN class_id_param INT)
BEGIN
    SELECT 
        u.user_name AS studentName,
        u.user_id AS studentId,
        st.roll_no,
        c.class_id,
        c.class_name,
        d.div_id,
        d.div_name,
        s.sub_name,
        tes.exmsub_id
    FROM (
        SELECT DISTINCT exmsub_class_id, exmsub_subject_id, exmsub_exam_id, exmsub_scanner_id, exmsub_id
        FROM tbl_exam_subject) AS tes
        JOIN tbl_subject s ON tes.exmsub_subject_id = s.sub_id
    JOIN tbl_class c ON tes.exmsub_class_id = c.class_id
    JOIN tbl_class_students st ON c.class_id = st.stud_class_id
    JOIN tbl_user u ON st.stud_user_id = u.user_id
    JOIN tbl_division d ON st.stud_div_id = d.div_id  
    
    WHERE tes.exmsub_scanner_id = scnusr_user_id_param
    AND tes.exmsub_exam_id = exam_id_param 
    AND c.class_id = class_id_param;
END ;;
