CREATE DEFINER=`root`@`localhost` PROCEDURE `GetExamDataToModeratorsSecondScreen`(IN user_id_param INT)
BEGIN
    SELECT 
        c.class_name, 
        c.class_id, 
        d.div_name, 
        d.div_id, 
        s.sub_name, 
        s.sub_id,
        e.exam_name, 
        e.exam_id, 
        es.exmsub_id,
        (SELECT COUNT(*) 
         FROM tbl_external_eval_anssheet 
         WHERE ex_moderator_id = user_id_param 
           AND ex_anssheet_status = 7
           AND ex_anssheet_exam_sub_id = es.exmsub_id) AS ans_sheet_count
    FROM                           
        tbl_external_eval_anssheet tea
    JOIN tbl_exam_subject es ON tea.ex_anssheet_exam_sub_id = es.exmsub_id
    JOIN tbl_exam e ON es.exmsub_exam_id = e.exam_id
    JOIN tbl_class c ON es.exmsub_class_id = c.class_id
    JOIN tbl_division d ON es.exmsub_division_id = d.div_id
    JOIN tbl_subject s ON es.exmsub_subject_id = s.sub_id    
    WHERE 
        tea.ex_anssheet_status = 7
        AND tea.ex_moderator_id = user_id_param
    GROUP BY 
        c.class_name, 
        c.class_id, 
        d.div_name, 
        d.div_id, 
        s.sub_name, 
        s.sub_id,
        e.exam_name, 
        e.exam_id, 
        es.exmsub_id;
END ;;
