CREATE DEFINER=`root`@`localhost` PROCEDURE `GetMenuAccessByRole`(IN user_id_param INT)
BEGIN
    SELECT 
       r.role_name,
        r.role_id,
        m.menu_name,
        m.menu_id,
        GROUP_CONCAT(CONCAT(tp.permission, '-', tp.permission_id)) AS permissions
    FROM tbl_role_menu_access rma
    JOIN tbl_role_menu_permission rmp ON rma.role_men_acc_menupermission_id = rmp.role_menu_per_id
   JOIN tbl_menu_permission mp ON rmp.rol_men_per_menuper_id = mp.menu_permission_id
    JOIN tbl_menu m ON mp.menu_per_menu_id = m.menu_id
    JOIN tbl_permission tp ON tp.permission_id = mp.menu_per_permission_id
    JOIN tbl_role r ON rma.role_men_acc_role_id=r.role_id
    WHERE rma.role_men_acc_user_id = user_id_param
    GROUP BY r.role_id, m.menu_id; -- Group by role and menu 
END ;;
