CREATE DEFINER=`root`@`localhost` PROCEDURE `GetResultData`(IN student_id_param INT)
BEGIN
    SELECT 
        c.class_name, 
        c.class_id, 
        e.exam_name, 
        e.exam_id,
        JSON_ARRAYAGG(
            JSON_OBJECT(
                'sub_name', s.sub_name,
                'sub_id', s.sub_id,
                'exmsub_id', es.exmsub_id,
                'Subject_Total_Marks', r.result_total_marks,
                'Subject_Obtained_Marks', r.result_obtained_marks,
                'Subject_remark', r.result_remark,
                'Subject_voice_remark', r.result_voice_remark,
                'Subject_Model_Ans_Link', es.model_ans_link
            )
        ) AS subjects
    FROM 
        tbl_result r
        JOIN tbl_exam_subject es ON r.result_exmsub_id = es.exmsub_id
        JOIN tbl_exam e ON es.exmsub_exam_id = e.exam_id
        JOIN tbl_class c ON es.exmsub_class_id = c.class_id
        JOIN tbl_subject s ON es.exmsub_subject_id = s.sub_id
    WHERE 
        r.result_student_id = student_id_param
    GROUP BY 
        c.class_id, e.exam_id;
END ;;
