CREATE DEFINER=`root`@`localhost` PROCEDURE `GetStudentResultForExam`(
    IN student_id_param INT, 
    IN exam_id_param INT,
    IN class_id_param INT
)
BEGIN
    SELECT 
        class_name, 
        class_id, 
        exam_name, 
        exam_id,
        SUM(result_total_marks) AS total_marks,
        SUM(result_obtained_marks) AS total_obtained_marks,
        (SUM(result_obtained_marks) / SUM(result_total_marks) * 100) AS percentage,
        JSON_ARRAYAGG(
            JSON_OBJECT(
                'sub_name', sub_name,
                'sub_id', sub_id,
                'exmsub_id', exmsub_id,
                'Subject_Total_Marks', result_total_marks,
                'Subject_Obtained_Marks', result_obtained_marks,
                'Subject_Remark', result_remark,
                'Subject_Voice_Remark', result_voice_remark,
                'Subject_Model_Ans_Link', model_ans_link,
                'Percentage', percentage,
                'Result_Status', result_status
            )
        ) AS subjects
    FROM 
        vw_comprehensive_results
    WHERE 
        result_student_id = student_id_param AND 
        exam_id = exam_id_param AND
        class_id = class_id_param
    GROUP BY 
         class_id, exam_id;
END ;;
DELIMITER ;
