CREATE DEFINER=`root`@`localhost` PROCEDURE `GetStudentsAnsSheetsForExEvaluator`(IN user_id_param INT,IN examsub_id_param INT)
BEGIN
    SELECT 
    ex_anssheet_exam_student_id,
      tea.ex_anssheet_link
        
    FROM 
        tbl_external_eval_anssheet tea
    JOIN tbl_exam_subject es ON tea.ex_anssheet_exam_sub_id = es.exmsub_id
    JOIN tbl_exam e ON es.exmsub_exam_id = e.exam_id
    JOIN tbl_class c ON es.exmsub_class_id = c.class_id
    JOIN tbl_division d ON es.exmsub_division_id = d.div_id
    JOIN tbl_subject s ON es.exmsub_subject_id = s.sub_id    
    WHERE 
         tea.ex_evaluator_id = user_id_param AND tea.ex_anssheet_exam_sub_id= examsub_id_param;
