CREATE DEFINER=`root`@`localhost` PROCEDURE `Publish_Exams_To_BO`(
 
    IN p_branchId INT,
    IN p_class_name VARCHAR(255),
    IN p_div_name VARCHAR(255),
    IN p_sub_name VARCHAR(255),
    IN p_exam_name VARCHAR(255),
    IN p_Total_marks INT,
    IN p_exmsub_id INT,
    IN p_standerd_id VARCHAR(255),
    IN p_userId VARCHAR(50)
)
BEGIN
    DECLARE v_branch_name VARCHAR(255);
    DECLARE v_anssheets_count INT;
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        -- Rollback the transaction in case of an error
        ROLLBACK;
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Error occurred, transaction rolled back';
    END;

    -- Start the transaction
    START TRANSACTION;

    -- Fetch the branch name
    SELECT branch_name INTO v_branch_name 
    FROM tbl_branch 
    WHERE branch_id = p_branchId;

    -- Handle case when branch is not found
    IF v_branch_name IS NULL THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Branch not found';
    END IF;

    -- Count ans_sheet_link from tbl_examsub_ans_sheet
    SELECT COUNT(ans_sheet_link) INTO v_anssheets_count
    FROM tbl_examsub_ans_sheet
    WHERE ans_sheet_exam_sub_id = p_exmsub_id;

    -- Insert into tbl_anssheets_log with the counted anssheets_count
    INSERT INTO tbl_anssheets_log (
        anssheets_school_name,
        anssheets_class_name,
        anssheets_div_name,
        anssheets_sub_name,
        anssheets_exam_name,
        anssheets_total_marks,
        anssheets_examsub_id,
        anssheets_school_id,
        anssheets_standerd_id,
        created_by,
       anssheets_total_log_count
    ) 
    VALUES (
        v_branch_name,
        p_class_name,
        p_div_name,
        p_sub_name,
        p_exam_name,
        p_Total_marks,
        p_exmsub_id,
        p_branchId,
        p_standerd_id,
        p_userId,
        v_anssheets_count
    );

    -- Update exam_status in tbl_exam_subject
    UPDATE tbl_exam_subject
    SET exam_status = 3
    WHERE exmsub_id = p_exmsub_id;

    -- Commit the transaction if everything is successful
    COMMIT;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
