CREATE DEFINER=`root`@`localhost` PROCEDURE `ResultDataForModerator`(


    IN student_id_param INT,
    IN examsub_id_param INT
)
BEGIN
    SELECT 
        JSON_OBJECT(
            'Result_Total_Marks', er.ex_result_total_marks,
            'Result_Obtained_Marks', er.ex_result_obtained_marks,
            'Result_Remark', er.ex_result_remark,
            'Result_Voice_Remark', er.ex_result_voice_remark,
            'Evaluations', JSON_ARRAYAGG(
                JSON_OBJECT(
                    'Question_Number', ae.ex_evaluation_que_id,
                    'Total_Que_Marks', ae.ex_evaluation_total_que_mark,
                    'Que_Obtained_Marks', ae.ex_evaluation_marks_obtained,
                    'Que_Remark', ae.ex_evaluation_remarks,
                    'Que_Voice_Remark', ae.ex_evaluation_voice_remark
                )
            )
        ) AS ResultData
    FROM 
        tbl_external_result er
    JOIN 
        tbl_ans_evaluation_ex_evaluator ae 
        ON er.ex_result_student_id = ae.ex_evaluation_student_id 
        AND er.ex_result_exmsub_id = ae.ex_evaluation_exam_sub_id 
    WHERE 
        er.ex_result_student_id = student_id_param 
        AND 
        er.ex_result_exmsub_id = examsub_id_param
    GROUP BY 
        er.ex_result_total_marks,
        er.ex_result_obtained_marks,
        er.ex_result_remark,
        er.ex_result_voice_remark;
END ;;
