CREATE DEFINER=`root`@`localhost` PROCEDURE `StudentsListForTeachersSecondScreen`(IN examsub_id_param INT)
BEGIN
    SELECT 
        u.user_name AS StudentName,                    -- Fetch student's name
        c.class_name AS ClassName,                     -- Fetch class name
        d.div_name AS DivisionName,                    -- Fetch division name
        s.sub_name AS SubjectName,                     -- Fetch subject name
        e.ans_sheet_link AS AnswerSheetLink,           -- Fetch answer sheet link
        e.stud_present AS PresentStatus,               -- Fetch student present status
        sr.sc_result_obtained_marks AS ObtainedMarks,  -- Fetch obtained marks from tbl_school_result
        es.exmsub_totalMarks AS TotalMarks             -- Fetch total marks from tbl_exam_subject
    FROM 
        tbl_school_result sr   
      
      JOIN 
        tbl_user u ON sr.sc_result_student_id = u.user_id 
      JOIN 
        tbl_exam_subject es ON sr.sc_result_exmsub_id = es.exmsub_id          
      JOIN 
        tbl_class c ON es.exmsub_class_id = c.class_id               
      JOIN 
        tbl_division d ON es.exmsub_division_id = d.div_id 
      JOIN 
          tbl_subject s ON es.exmsub_subject_id = s.sub_id            
      JOIN 
        tbl_examsub_ans_sheet e ON sr.sc_result_student_id = e.ans_sheet_stud_id 
                               AND sr.sc_result_exmsub_id = e.ans_sheet_exam_sub_id		                               
		
    WHERE 
        sr.sc_result_exmsub_id = examsub_id_param;                    
END ;;
